interface GmapProps {
    locationFrom: Coords | undefined;
    locationTo: Coords | undefined;
}

interface GmapState {
    defaultCenter: Coords | undefined;
    center: Coords | undefined;
    defaultZoom: number;
    googleAPIkey: string;
    map: any | null;
    maps: any | null;
    mapLoaded: boolean;
    places: any[];
}

const createMapOptions = () => {
    return {
        // black and white map
        styles: [{stylers: [{'saturation': -100}, {'gamma': .8}, {'lightness': 5}]}]
    };
}

// InfoWindow component
const InfoWindow = (props: { place: any; }) => {
    const {place} = props;
    const infoWindowStyle = {
        position: 'relative',
        bottom: 150,
        left: '-45px',
        width: 220,
        backgroundColor: 'white',
        boxShadow: '0 2px 7px 1px rgba(0, 0, 0, 0.3)',
        padding: 10,
        fontSize: 14,
        zIndex: 100,
    };

    return (
        // @ts-ignore
        <div style={infoWindowStyle}>
            <div style={{fontSize: 16}}>
                Windisch
            </div>
            <div style={{fontSize: 14, color: 'green'}}>
                Incidence: 127.5
            </div>
        </div>
    );
};

// Marker component
const Marker = ({show, place}: any) => {
    const markerStyle = {
        border: '2px solid white',
        borderRadius: '50%',
        height: 20,
        width: 20,
        backgroundColor: show ? 'red' : '#394d90',
        cursor: 'pointer',
        zIndex: 10,
    };

    return (
        <>
            <div style={markerStyle}/>
            {show && <InfoWindow place={place}/>}
        </>
    );
};


